INSERT INTO `grafico` VALUES (1,'DSG','% de satisfacción laboral institucional','Gráfico de resultados de la percepción general de Satisfacción o Insatisfacción que poseen los/las Funcionarios/as respecto a la Institución, indicando el porcentaje de respuesta y la cantidad de Funcionarios/as que se encuentran dentro de los niveles de \"Muy Satisfechos\", \"Satisfechos\", \"Insatisfechos\", \"Muy Insatisfechos\" y \"Ni Satisfechos Ni Insatisfechos\".'),(2,'DSCR','% de satisfacción laboral por centro de responsabilidad','En el gráfico se muestra la distribución de funcionarios/as por cada nivel de satisfacción para cada Centro de Responsabilidad en estudio. La distribución se presenta en %.'),(3,'DSV','% de satisfacción laboral por variables','En el gráfico se muestra la distribución de funcionarios/as por cada nivel de satisfacción para cada Variable. La distribución se presenta en %.'),(4,'PCRPI','Indice promedio de satisfacción laboral por centro de responsabilidad','Gráfico de Índice promedio de Satisfacción Laboral (puntaje promedio obtenido) por cada Centro de Responsabilidad, comparado con al Índice Promedio General de la Institución.'),(5,'PVPI','Indice promedio de satisfacción laboral por variables','Gráfico de Índice promedio de Satisfacción Laboral (puntaje promedio obtenido) por cada Variable, comparado con al Índice Promedio General de la Institución.'),(6,'TC','Medidas de tendencia central del indice promedio de satisfacción laboral','Se identifica la distribución general de las respuestas de los/as funcionarios/as por cada Variable a través de la Media, Mediana y Moda (Medidas de Tendencia Central).'),(7,'INV','Inventario de satisfactores e insatisfactores','Se indican los reactivos (preguntas) que tuvieron una mayor percepción de Satisfacción (con resultados de satisfacción por sobre la desviación estándar) como Satisfactores Laborales, y los reactivos (preguntas) que obtuvieron mayor percepción de Insatisfacción (con resultados de Insatisfacción por sobre la desviación estándar) como Insatisfactores Laborales.'),(8,'BS','Balance Social','El Balance de Satisfacción Laboral indica los resultados netos (número de funcionarios/as) que se encuentran en niveles de “Muy Satisfechos” y “Satisfechos”, los que son agrupados como ACTIVOS LABORALES, los funcionarios/as que se encuentran en niveles de “Muy Insatisfechos” e “Insatisfechos”, agrupados como PASIVOS LABORALES, mientras que los “Ni Satisfechos ni Insatisfechos”, se agrupan como NEUTROS.'),(9,'ISTA','Semáforo','Gráfico de las prevalencias (porcentajes) de trabajadores en cada nivel de riesgo.'),(10,'PR','Variables priorizadas por los/as funcionarios/as','Grafico indica la priorización realizada por los/las Funcionarios/as de la Institución considerando las variables que ellos consideren de mayor a menor importancia para su Satisfacción Laboral.'),(11,'BST1','Tabla 1 : Valores Netos (cantidad de funcionarios/as)',NULL),(12,'BST2','Tabla 2 : Valores porcentuales',NULL),(13,'SEG1','Gráfico Segmentación Estamento','Gráfico Segmentación Estamento'),(14,'SEG2','Gráfico Segmentación por Género','Gráfico Segmentación por Género'),(15,'SEG3','Gráfico Segmentación por Calidad Jurídica ','Gráfico Segmentación por Calidad Jurídica '),(16,'SEG4','Gráfico Segmentación por Antiguedad','Gráfico Segmentación por Antiguedad'),(17,'ranking','Gráfico Ranking','Gráfico Ranking');
/*!40000 ALTER TABLE `grafico` ENABLE KEYS */;
