INSERT INTO `pabiertas` VALUES (28,'Area2','me produce una insatisfacción laboral profunda la alta carga administrativa que no tiene nada que ver con las labores a las cuales fuimos encomendados, tengo la sensación que se trata de amarrar administrativamente a los investigadores basándose en la desconfianza. Existe muchísima burocracia y se aprovecha de las finanzas de cada investigador al momento de rendir fondos que aun no han sido entregados. Además se trata de centralizar todo en la unidad de finanzas siendo que los investigadores podrían mantener muchisimo más eficientemente la contabilidad en cuentas de su poder como pasa en las universidades u otros centros de investigación. Además no se pagan incentivos por proyectos o publicaciones que se generan.',133,1),(27,'Area1','A mi me genera satisfacción laboral cuando veo que se apoya la independencia en el desarrollo de la investigación, cuando los temas son motivantes y no son impuestos por la jefatura sino que vienen del trabajo que se realiza entre los colegas.',133,1),(29,'Area1','Representar a INFOR en simposios y conferencias.',176,1),(30,'Area2','Falta de reconocimiento. Mejorar estimulos.',176,1),(31,'Area1','INFOR es una institución que año a año se supera en terminos de lo que se hace y en la calidad de su equipo humano. Así es como es como la institución es vada vez más conocida nacionalmente por llevar soluciones a los problemas locales.',15,1),(32,'Area2','',15,1),(33,'Area1','Trabajos bien planificados que generan información o resultados relevantes.',32,1),(34,'Area2','Hay períodos en que se presiona al investigador por productos del Ärea de investigación y de la Gerencia, lo que se traduce en trabajo extra en el hogar. Una adecuada coordinación pudiese atenuar estos momentos estresantes.',32,1),(35,'Area1','Actividades colectivas extraprogramáticas.\r\nMejorar vínculo de colaboración con personas e instituciones\r\n',145,1),(36,'Area2','Planificación anual de actividades extrapogramáticas.\r\nidentificar socios estratégicos y planificar trabajo colaborativo',145,1),(37,'Area1','Poder trabajar en una idea y luego terminarla con un articulo en revista indexada y que esto tenga el debido reconocimiento institucional.',179,1),(38,'Area2','No poder definir las prioridades y temas de investigación, y luego liderarlos.',179,1),(39,'Area1','El proponer ideas nuevas y ser escuchada y respaldada por la dirección ejecutiva, particularmente por el director.',23,1),(40,'Area2','Las malas interpretaciones cuando se realiza un trabajo y se \"cree\" que algo sucedió por tal motivo, se comenta pero no existe ninguna certeza.',23,1),(41,'Area1','Interacción con diversas disciplinas y visiones',16,1),(42,'Area2','Indefiniciones y estrategias poco definidas',16,1),(43,'Area1','Reconocimiento por los logros alcanzados a nivel institucional (equipos de trabajo), como personales.',136,1),(44,'Area2','Falta de criterios no igualitarios entre investigadores en situaciones de tipo laboral (responsabilidad laboral, apoyo en actividades institucionales de carácter regional); además de la baja aplicabilidad de los acuerdos alcanzados en reuniones de sede, traduciéndose en perdida de tiempo, desincentivo al dialogo y participación.  ',136,1),(45,'Area1','Tiempo y espacio para hacer actividad física dentro del horario laboral (hora de almuerzo) y adquisición de implementos de gimnasia. ',178,1),(46,'Area2','ninguna',178,1),(47,'Area1','Ambiente laboral.',164,1),(48,'Area2','las posibilidades de relacionarse con los colegas de otras sedes para la realización y ejecución de proyectos y de poder visitar las otras sedes. También me no me satisface la posibilidad de participar y/o asistir a las charlas, seminarios o cursos que llegan las invitaciones.\r\nUna manera de mejorar es contar con el/los recursos económicos para que se puedan llevar a cabo dichas actividades participativas. Y también podría existir la instancia para relacionarse con las otras sedes en presencial.',164,1),(49,'Area1','',140,1),(50,'Area2','',140,1),(51,'Area1','Trabajo en equipo, esfuerzos de mejor comunicación y planificación organizacional',8,1),(52,'Area2','Distribución y asignación de remuneraciones, hay una percepción que es discrecional según lo que plantea cada persona nos una definición de política de remuneraciones.',8,1),(53,'Area1','Satisfacción es el cuuriculum de proyectos que tiene la institución',149,1),(54,'Area2','Situaciones de Inequidad, grados se otorgan sin igualdad, viaticos no son iguales para todos. ',149,1),(55,'Area1','CUANDO LOS PROCESOS SON CONOCIDOS Y RESPETADOS POR TODOS EL TRABAJO FLUYE CON RAPIDEZ Y EN FORMA PRECISA.',123,1),(56,'Area2','AL REVES DE LO ANTERIOR, CUANDO NO SE RESPETAN LOS PROCESOS INTERNOS SE PRODUCEN INCONVENIENTES.  LA MEJORA CONSISTE EN MOTIVAR\r\nPARA QUE CADA UNO CUMPLA A CABALIDAD CON SU PARTE DEL PROCESO.',123,1),(57,'Area1','',30,1),(58,'Area2','La falta de control que existe hacia algunos investigadores respecto a sus actividades, ya que existen algunos que trabajan mas como técnicos de terreno por lo beneficios económicos que implica salir a terreno. \r\nLa falta de evaluación de desempeño en donde se establezca cuales son mis obligaciones, que premie a quienes cumplen y que sancione a quienes incumplan con los compromisos adquiridos.\r\n',30,1),(59,'Area1','Cuando se trabaja coordinadamente, cada uno cumpliendo con sus compromisos para cumplir las metas a tiempo y entregando trabajos de calidad. El trabajo horizontal en en equipo con retroalimentación entre los investigadores, tomando las decisiones en equipo.',156,1),(60,'Area2','Cuando se toman decisiones sin consultar al equipo de trabajo en círculos cerrados de los investigadores a cargo de áreas, líneas y gerente de sede. Muchas veces se consulta en reuniones de sede a los investigadores y técnicos pero después se tomas decisiones, muchas veces malas decisiones, unilateralmente. Siento que muchas veces no se toma mi opinión en cuenta.\r\nExisten consideraciones especiales hacia ciertos investigadores, no habiendo un mismo trato para todos. \r\nMuchas veces siento que el trabajo no está bien coordinado y que no puedo avanzar por decisiones unilaterales, lo que produce que el trabajo se atrase y que el producto final no sea de calidad.\r\nLa mejora es que las decisiones que se tomen a nivel de sede considerándose la opinión de todos y que en el grupo de trabajo se trabaje realmente en equipo, habiendo una mejor coordinación del grupo de trabajo.',156,1),(61,'Area1','',26,1),(62,'Area2','',26,1),(63,'Area1','',22,1),(64,'Area2','',22,1),(65,'Area1','La posibilidad aunque limitada de poder ir aprendiendo cosas nuevas, nuestro papel de investigador nos da la posibilidad de abrirse a nuevos temas y crecer, ciertamente esto depende de las propias personas. ',169,1),(66,'Area2','que no se discutan los temas de manera abierta, no solapada, porqué tener temor a manifestar los desacuerdos? También las relaciones humanas se han ido deteriorando con el tiempo.',169,1),(67,'Area1','El nivel de relaciones personales dentro de algunas sedes y equipos de trabajos, que facilitan el que hacer institucional.',131,1),(68,'Area2','falta de trabajo real en equipo, vincular realmente las áreas y lineas a nivel nacional y no solo a nivel de equipos concretos de trabajo. Que los coordinadores asuman la responsabilidad de liderar equipos de trabajos y que esta responsabilidad esté asociada a incentivos concretos para estos investigadores.',131,1),(69,'Area1','Este año participé de una capacitación de Excel que fue de mucha ayuda, aumentó mis conocimientos en esta area que es clave para mi trabajo y desarrollo.',12,1),(70,'Area2','Proyectos que entregan incentivos a \"algunos\" administrativos, lo que me genera disconformidad, porque todos trabajamos para todos los proyectos, no me parece justo que sólo algunos reciban beneficios y otros no, si hay beneficios para administrativos, estos debiesen ser en igual monto para todos.',12,1),(71,'Area1','',144,1),(72,'Area2','',144,1),(73,'Area1','Que exista un bajo nivel de control de las actividades desarrolladas por algunos técnicos e investigadores durante las actividades de campo, es inaceptable que no se lleve el control de rendimientos y actividades a desarrollar, en donde los investigadores responsables debiesen cumplir un rol fiscalizador sobre sus propios proyectos en ejecución. No es aceptable que actividades posibles de desarrollar en 1 o 2 días de campo sean llevadas a cabo en 3 o 4 días solo con el fin de generar sobresueldos dadas las asignaciones de viáticos que se generan. Por otro lado, no es posible que los montos que sean gastados en proyectos superen, en algunos casos con creces, los montos asignados pasa su ejecución, generando que otros proyectos subsidien la mala gestión de los recursos de proyectos y muchas veces subsidiando este sobresueldo que algunos investigadores descriteriados generan mensualmente.',34,1),(74,'Area2','En la institución no existe claridad de las funciones que deben desempeñar bajo el cargo asignado, principalmente bajo el cargo de investigador, donde muchos \"investigadores\" no realizan investigación y desempeñan labores más de gestión propias de un \"asistente de investigación\". Bajo el cargo de \"investigador\" se debiese exigir alguna cantidad mínima de proyectos ya sea como director de proyectos o direcciones alternas, en donde el incumplimiento de esto lleve a medidas sancionatorias ya sea en remuneraciones o permanencia en la institución. El control de estas actividades debiese ser considerado en evaluaciones de desempeño, que actualmente no son llevadas a cabo porque no existe el instrumento. \r\nEn donde además, ante buenos resultados en evaluaciones de desempeño se debiesen generar incentivos reflejados tanto en remuneraciones como en condiciones laborales, siempre favoreciendo la mejora en las condiciones de trabajo ya sea de los investigadores como de los equipos de investigación, permitiendo de esta manera un crecimiento sostenido en la calidad y cantidad de investigación que se genera al interior de la institución.',34,1),(75,'Area1','',5,1),(76,'Area2','',5,1),(77,'Area1','La gerencia de administración y finanzas no tiene un trato adecuado con su personal , se sugiere trabajar habilidades blandas.',28,1),(78,'Area2','Se requiere informar sobre los beneficios institucionales y que se repliquen de la misma forma para todos los funcionarios sin distinción.',28,1),(79,'Area1','El reconocimiento de la institucón y posicionamiento que ha tenido en el último tiempo',118,1),(80,'Area2','La falta de coordinación y planificación ya que siempre se está improvisando y todo se realiza en forma rápida para salir del paso y si algo sale mal el resposable es quien realiza el trabajo pero no se considera que la falla pudo haber sido por la falta de uno de los aspectos antes mencionados.',118,1),(81,'Area1','',186,1),(82,'Area2','',186,1),(83,'Area1','',159,1),(84,'Area2','',159,1),(85,'Area1','Cuando la labor realizada por el equipo de trabajo es reconocida en el Sector Forestal.',174,1),(86,'Area2','Genera insatisfacción laboral las inconsistencias que se producen en la institución, por ejemplo nuestra área de trabajo históricamente fue financiada 100% por el contrato de desempeño, pero a partir de este año, arbitrariamente, la dirección decide que el aporte baja al 85%, da una amarga sensación de que quedamos debiendo a la institución, pese a estar en un año de modernización de sistemas, con todo el trabajo extra que estos cambios originan.',174,1),(87,'Area1','nivel de compañerismo',10,1),(88,'Area2','1. Los cargos son mas bien por amistad que por capacidad\r\n2. No hay una política clara con respecto a los sueldos\r\n',10,1),(89,'Area1','La presencia de profesionales técnicos que apoyan la labor de los investigadores, con su ayuda ellos permiten que nuestro trabajo de campo sea óptimo. Se necesitan mas técnicos en Infor!! ',148,1),(90,'Area2','La gran parte de mi tiempo para investigación dedicado a la administración. Mi propuesta para mejorarlo es que el sistema de administración incorpore mas herramientas digitales para optimizar tiempos y reducir uso de papel. ',148,1),(91,'Area1','La oportunidad para poder realizar actividades de investigación en las áreas que son de mi total interés. La posibilidad de trabajar y profundizar lineas de investigación que me interesan. El ambiente de trabajo actual es muy agradable entre los colegas. Me gusta mucho mi trabajo.',109,1),(92,'Area2','Me genera insatisfacción laboral que otros colegas no se mojen la camiseta por la institución. \r\nLa posición cómoda de algunos colegas de no generar proyectos, de no publicar y de solo marcar el paso. \r\nQue muchos de esos mismos colegas tengan un sueldo mayor que el mio, siendo que mi CV en términos académicos y técnicos es superior.\r\nEl escaso control de muchas actividades en campo, por parte de los jefes de proyecto, siendo que hay actividades en los cuales se puede ser más eficiente en términos de recursos económicos y humanos.\r\n',109,1),(93,'Area1','Cuando se logra un buen trabajo, gracias a desarrollarse con autonomía en base a la confianza del equipo o jefaturas.  Y mejor aún si  eso es reconocido.',9,1),(94,'Area2','Cuando no hay, hay poco o se demora los medios o herramientas para desarrollar un trabajo determinado.',9,1),(95,'Area1','El reconocimiento del trabajo y esfuerzo realizado',7,1),(96,'Area2','la confusión de roles y responsabilidades',7,1),(97,'Area1','El horario de trabajo.',11,1),(98,'Area2','Considero que el Gerente de área no este en la la misma sede donde esta su Gerencia provoca problemas de comunicación y falta de trabajo en equipo. Además de descoordinación en los distintos departamentos que conforman la Gerencia.\r\nTambién considero que se valora mas al área de investigación forestal que al área de administración, provocando una desvalorización de nuestro trabajo.\r\nNo existe evaluación de desempeño y no hay una clara determinación de incentivos o aumentos de remuneraciones\r\n',11,1),(99,'Area1','',130,1),(100,'Area2','',130,1),(101,'Area1','Buena calidad en la comunicación del equipo de trabajo y la excelente cooperación dentro de este ',35,1),(102,'Area2','Dificultad en trabajo de oficina por mala aislación térmica, tanto en verano como en invierno.',35,1),(103,'Area1','',165,1),(104,'Area2','Trato frío e indiferente de mi jefatura, provocando desmotivación y desinterés en mi quehacer diario, diciendome y haciendome sentir que todo lo que yo hago está mal:  labor que he realizado mas de treinta años en mi querido Infor.    Me haría realmente feliz, el cambio de mi jefatura directa',165,1),(105,'Area1','Buen ambiente de trabajo y comunicaciones entre todos',163,1),(106,'Area2','Poca transparencia en las comunicaciones y toma de decisiones. \r\nFalta de capacitación dirigida según las actividades del cargo/actividad que realizó\r\n',163,1),(107,'Area1','El logro de metas que tienen impactos y su reconocimiento en forma personal y colectiva, en un ambiente de trabajo sano y colaborador.',146,1),(108,'Area2','La sobrecarga de trabajo, creo que se requiere de una distribución más homogénea en el cumplimiento de compromisos institucionales',146,1),(109,'Area1','La buena relación que existe entre el equipo de trabajo y el gerente de sede. ',188,1),(110,'Area2','Falta de coordinación entre jefes de proyectos.',188,1),(111,'Area1','',152,1),(112,'Area2','',152,1),(113,'Area1','El ambiente entre colegas es en general muy bueno',18,1),(114,'Area2','Las diferencias en los beneficios derivados del contrato colectivo de trabajo. Se pueden negociar beneficios que no necesariamente generen un costo institucional directo, como por ejemplo una hora de trabajo menos el día viernes o un día adicional de vacaciones, o día (o tarde) de cumpleaños libre, etc.',18,1),(115,'Area1','',180,1),(116,'Area2','',180,1),(117,'Area1','',147,1),(118,'Area2','',147,1),(119,'Area1','Se otorga libertad para decidir y se respeta