fatura',36,1),(135,'Area1','Mayor visibilización de INFOR en la comunidad alcanzado en el último tiempo',170,1),(136,'Area2','',170,1),(137,'Area1','momentos de intercambio de opiniones, café. Instancias de dialogo respecto a temas laborales.\r\n',173,1),(138,'Area2','ambiente poco grato de trabajo, rumores, falta de espacio para compartir.',173,1),(139,'Area1','Incentivos por responsabilidad y reconocimiento de los logros.\r\n',172,1),(140,'Area2','',172,1),(141,'Area1','Generar información para el desarrollo forestal del país en beneficio de los propietarios forestales y en la conservación de los recursoso',121,1),(142,'Area2','escaso apoyo en la innovación y la propiedad intelectual de los productos de INFOR. Se requiere de generar una cultura al interior de la organización.\r\n\r\nNo reconocer el aporte que el trabajo y el pertenecer a INFOR genera como satisfacción y orgullo personal. Se requiere motivar el compromiso y orgullo de trabajar en INFOR \"No es sólo un trabajo más\"',121,1),(143,'Area1','Entorno natural, estacionamiento gratis, almuerzo gratis',117,1),(144,'Area2','machismo. Tomar en serio la igualdad de genero. Siempre se siente como que se hace por cumplir, pero no existe un compromiso real con la igualdad de genero. Siguen dándoseles tareas a las mujeres que \"tradicionalmente\" hacen, jamas se le dan funciones de ese tipo a los hombres (organizar eventos, organizar ágapes para distintas celebraciones o eventos, recibir a los invitados, etc.',117,1),(145,'Area1','Estar realizando proyectos que generan beneficios sociales y que se conectan con mis convicciones',126,1),(146,'Area2','La comunicación no es fluida. Generar confianzas',126,1),(147,'Area1','',111,1),(148,'Area2','',111,1),(149,'Area1','',153,1),(150,'Area2','',153,1),(151,'Area1','',154,1),(152,'Area2','La falta de evaluación del trabajo realizado y reconocimiento institucional, junto a la alta carga de labores administrativas que podrían facilitarse con mejoras en los sistemas de gestión.',154,1),(153,'Area1','',166,1),(154,'Area2','',166,1),(155,'Area1','Estabilidad laboral, ambiente de trabajo, desarrollo personal, nuevos desafíos y nivel de remuneración.',151,1),(156,'Area2','Escasa oportunidad de participación en la decisión. Mayor consideración en la toma de decisiones para el cumplimiento de objetivos\r\nTraspaso de la linea de confianza. Generar estrategias de conversación para evitar problemas de convivencia.\r\n',151,1),(157,'Area1','Realizar mi trabajo y compartir con los compañeros en Aniversarios de INFOR donde asisten todas las sedes regionales',167,1),(158,'Area2','el mal trato que dan 2 gerentes (Metrop-Finanzas) a sus funcionarios, el clasismo de los Gerentes y la preferencia hacia algunos \"preferidos/investigadores\"',167,1),(159,'Area1','Adjudicación de proyectos, trabajar en proyectos con sentido.',185,1),(160,'Area2','Poca autonomía para desarrollar el trabajo.',185,1),(161,'Area1','Que se respeten los protocolos de comunicación y no se baipasee a los encargados de proyectos\r\n\r\n',187,1),(162,'Area2','Que exista acoso laboral, quitar tareas y responsabilidades, trato desigual\r\nQue el trabajo técnico pierda independencia por temas e intereses políticos ',187,1),(163,'Area1','el ambiente laboral',191,1),(164,'Area2','',191,1),(165,'Area1','',137,1),(166,'Area2','Insatifacción laboral el hecho de que la Gerencia de Finanzas no reconozca lo sobre exigido que se encuentran algunos cargos administrativos.',137,1),(167,'Area1','',21,1),(168,'Area2','',21,1),(169,'Area1','',3,1),(170,'Area2','',3,1),(171,'Area1','Motivos de satisfacción:  Horario de trabajo, beneficios que otorga la empresa, relaciones personales (en la mayoría de los casos).',24,1),(172,'Area2','- Sueldo, bajo en relación a investigadores\r\n- Pocas posibilidades de ascenso\r\n\r\nOpción para revertirlo: Alguna herramienta que permita medir el rendimiento de cada uno, como puede ser la Evaluación de Desempeño\r\n',24,1),(173,'Area1','',112,1),(174,'Area2','',112,1),(175,'Area1','',110,1),(176,'Area2','La falta de incentivos al obtener proyectos y grados académicos. En Infor falta una politica clara de incentivos en remuneración para su personal. El mensaje que siempre se deja en la reuniones con las jefaturas es que se incentiva a tener muchos proyectos, pero sin ningún tipo de incentivo para el equipo que los realiza. Por lo menos esa situación a mi no me motiva. Cualquier Centro de investigación de clase mundial tiene una política de incentivos establecida para sus profesionales que generan ideas para proyectos, que es el capital más importante que tienen. Pienso que se generarían y adjudicarían muchos más proyectos en Infor con una política de incentivos clara.',110,1),(177,'Area1','',17,1),(178,'Area2','',17,1),(179,'Area1','Grato ambiente de trabajo de investigadores, con espacios para pensar y espacios para ejecutar. ',171,1),(180,'Area2','Falta de política de remuneraciones: hay aumentos de sueldo por conversación directa de los interesados con los jefes;  hay personas que han sido jefes, dejan de serlo, pero mantienen los sueldos, etc., etc.\r\nFalta de evaluación de desempeño: hace varios años que esto se promete y no se cumple, no pasa nada, nadie se inmuta y esto incide directamente en la calidad del trabajo.\r\nFalta de sanciones a los que no cumplen lo que tienen que hacer.\r\n',171,1),(181,'Area1','El ambiente distendido entre los colegas. Importante mantener esto ya que somos una sede con pocos funcionarios y es de suma relevancia mantener esas relaciones para poder llevar el día a día de la mejor manera posible. Lo anterior debido a que lamentablemente en este país se pasan más horas en el trabajo que en el hogar,por lo que nuestros colegas pasan a ser parte de nuestra segunda familia.',190,1),(182,'Area2','Ampliar el lugar de trabajo, ya que en un espacio reducido desempeñamos nuestras funciones a los menos 6 funcionarios. Ampliar las instalaciones.',190,1),(183,'Area1','Encuentro loable que la Dirección 