 más en red.',184,1),(206,'Area2','Todo el tema administrativo es largo y lento, desde cotizaciones hasta compra, requiere de mucho tiempo, podría acortarse los tiempos con cambios de procesos, revisar formas en las que otros instituciones tengan mecanismo más fluidos. Considerar las especificidades de los territorios en estos aspectos, por ejemplo no siempre se puede contar con 3 cotizaciones en una comunidad o localidad donde existen pocos oferentes, como ocurre en Aysén.',184,1),(207,'Area1','Trabajo en equipo',115,1),(208,'Area2','Falta de interacción con la gerencia de innovación. Mayor comunicación y trabajo en conjunto',115,1),(209,'Area1','',161,1),(210,'Area2','Poca coordinación entre los gerentes de sede y la dirección.\r\nDa la sensación que el subdirector decide y los demás acatan.\r\nNo existe política de RRHH. Al parecer no existe empatía y preocupan por el Gestor de RRHH hacia situaciones complejas que presenta el personal.  Solo Patricio Parra hace un esfuerzo por solucionar algunos temas.\r\nSoluciòn:\r\n\r\nDejar de actuar como instancias separadas, las áreas y la dirección no son institutos aparte, deben trabajar coordinadamente. Da la impresión y es lo que manifiesta el subdirector, que cada unidad es independiente y decide muchas cosas solo, pero falta una linea en común.\r\nTodos queremos mucho a INFOR y nos sentimos gratos, pero falta sentir la conexión con los directivos y las otras sedes.\r\n\r\n\r\n',161,1),(211,'Area1','Iniciativas de trabajo abordadas como equipo de trabajo y que llegan a buen término. ',114,1),(212,'Area2','Que la jefatura no reconozca en todos sus subalternos los aportes que hace a la institución y la dedicación que estos realizan. La jefatura debe preocuparse de reconocer el trabajo de todos y cada uno de sus subalternos, y ene ese sentido tener el cuidado de hacerlo. ',114,1),(213,'Area1','Mi trabajo en sede Valdivia Gran equipo de trabajo y la incorporación de Profesionales nuevos de gran nivel entusiasmo y calidad humana, en general  todo el personal de INFOR de gran entrega y compromiso , en mi trabajo viajo a muchas regiones y visito todas las sedes , siempre muy buena recepción y ayuda en todo. Me siento muy bien en Sede Valdivia y siento que confian en mi persona.',134,1),(214,'Area2','En trabajos con jefes de proyecto de sede Santiago he tenido conflictos serios, por desconfianzas   hacia mi persona , por recarga laboral al ponerme en proyectos Fondef poco tiempo y planificar actividades que sobrepasan esos tiempos. También al pedir encuestas de industria primara, cada año más trabajo y menos tiempo para hacerlo, estos jefes de proyecto se han quejado con la dirección ejecutiva y yo solo he podido hacer mis descargos con sub director y gerente de sede, resultando de todo esto mi marginación de esos equipos de trabajo, lo cual me ha dejado satisfecho, me parece indigno que se desconfie de las personas sin hacer todo esto formalmente.',134,1),(215,'Area1','',157,1),(216,'Area2','',157,1),(217,'Area1','',192,1),(218,'Area2','',192,1);
