INSERT INTO `slorg_admin` VALUES (2,1,'','CUESTIONARIO DE SATISFACCION LABORAL','<p>Estimados funcionarios (as),</p><p>El Estudio de Satisfacción Laboral (ESL) busca determinar las variables que pueden incidir positiva y/o negativamente sobre la percepción que tienen los funcionarios sobre la organización que conforman, mediante la generación de un Balance Social Laboral.</p><p>Antes de Responder el Cuestionario debe considerar que:<br/>El éxito de este Estudio depende de su colaboración y sinceridad al responder. Además, le aseguramos que la información entregada por usted será CONFIDENCIAL.</p><p>INSTRUCCIONES:</p><p>A continuación encontrará una serie de PROPOSICIONES, frente a cada una de ellas usted debe seleccionar la alternativa que mejor lo represente.</p><p>Es importante, que usted responda TODAS las PROPOSICIONES, de lo contrario su Cuestionario no podrá ser considerado para el análisis. Cabe señalar que no existen respuestas buenas o malas, correctas o incorrectas, solo nos interesa su OPINIÓN.</p><p>Para focalizar los resultados y elaborar Planes de Acción más efectivos, es necesario diferenciar la información recogida en el Cuestionario, para tales efectos, le agradecemos seleccionar la información que corresponda a sus datos:</p>','','',0,0,1),(3,5,'lokjhnbgf','lkjhgfcd','lkjhgfds','','',0,1,0);
