INSERT INTO `slorg_elemento_formulario` VALUES (1,'Formulario 1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,'2015-08-03 09:00:00','2015-12-11 12:00:00'),(3,'Texto Bienvenida','<h3 align=\'center\'>CUESTIONARIO DE SATISFACCION/CLIMA LABORAL\n</h3>\n<br>\n<p>Estimados/as colaboradores (as),</p><p>El Estudio de Satisfacción Laboral (ESL) busca determinar las variables que pueden incidir positiva y/o negativamente sobre la percepción que tienen los funcionarios sobre la organización que conforman, mediante la generación de un Balance Social Laboral.El Estudio de Satisfacción/Clima Laboral busca determinar las variables que pueden incidir positiva y/o negativamente sobre la percepción que tienen los colaboradores sobre la organización que conforman, mediante la generación de un Balance de Satisfacción Laboral.\n</p><p>Antes de Responder el Cuestionario debe considerar que:<br/>El éxito de este Estudio depende de su colaboración y sinceridad al responder. Además, le aseguramos que la información entregada por usted será CONFIDENCIAL.</p>',NULL,1,NULL,NULL,NULL,1,NULL,NULL,1,2,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Centros de Responsabilidad',NULL,'I. CENTRO DE RESPONSABILIDAD',1,NULL,NULL,3,3,1,NULL,1,2,1,4,1,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Segmentación',NULL,NULL,1,4,NULL,NULL,4,0,NULL,1,2,1,1,2,NULL,1,1,NULL,'Seleccione',NULL,NULL,NULL),(6,'Pregunta Cuestionario',NULL,'VI. A CONTINUACION SEÑALE SU NIVEL DE SATISFACCIÓN DE LAS SIGUIENTES PROPOSICIONES:',1,3,NULL,NULL,5,1,NULL,1,2,1,1,1,1,1,1,'Nº','PROPOSICION. <br><br>CONSIDERE COMO SU JEFATURA A LA DIRECCIÓN EJECUTIVA, SUB DIRECCIÓN EJECUTIVA Y GERENCIAS SEGÚN CORRESPONDA',NULL,NULL,NULL),(7,'Selección de Nivel de Importancia',NULL,'VII. A CONTINUACION, UD. ENCONTRARA UNA LISTA DE VARIABLES QUE INFLUYEN EN LA SATISFACCIÓN LABORAL. \n\n<UL>\n<LI>ORDENE DEL 1 AL @@COUNT_NIVEL_NEGOCIO@@, SEGUN EL NIVEL DE IMPORTANCIA QUE TIENEN PARA USTED CADA UNA DE ELLAS.\n</LI>\n<LI>\nSEÑALE CON EL NUMERO 1 LA MAS IMPORTANTE Y CON EL NUMERO @@COUNT_NIVEL_NEGOCIO@@ LA MENOS IMPORTANTE. \n</LI>\n</UL>',1,2,NULL,NULL,7,1,NULL,1,2,1,1,1,7,1,1,'Nº','VARIABLES ',NULL,NULL,NULL),(8,'Boton Guardar','Guardar',NULL,1,NULL,NULL,NULL,8,NULL,NULL,1,2,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Boton Guardado Parcial','Guardar y Continuar',NULL,1,NULL,NULL,NULL,6,NULL,NULL,1,2,0,8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Texto Instrucciones','\r\n<p align=\'center\'><h4><b>INSTRUCCIONES:</b></h4></p>\r\n<p>A continuación encontrará una serie de PROPOSICIONES, frente a cada una de ellas usted debe seleccionar la alternativa que mejor lo represente.</p><p>Es importante, que usted responda TODAS las PROPOSICIONES, de lo contrario su Cuestionario no podrá ser considerado para el análisis. Cabe señalar que no existen respuestas buenas o malas, correctas o incorrectas, solo nos interesa su OPINIÓN.</p><p>Para focalizar los resultados y elaborar Planes de Acción más efectivos, es necesario diferenciar la información recogida en el Cuestionario, para tales efectos, le agradecemos seleccionar la información que corresponda a sus datos:</p>',NULL,1,NULL,NULL,NULL,2,NULL,NULL,1,2,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Formulario Istas',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Texto Bienvenida','<table  cellpadding=\'10\'>\r\n<tr>\r\n <td width=\'10%\'>\r\n<br>\r\n<img src=\'images/suseso.png\'>\r\n\r\n</td>\r\n<td align=\'center\'>\r\n<b>\r\n<h3>Cuestionario SUSESO ISTAS 21 Versión Breve</h3>\r\n</b>\r\n</td>\r\n <td width=\'10%\'>\r\n<br>\r\n<img src=\'images/logosinrefl.png\' width=\'110px\' height=\'94px\'>\r\n\r\n</td>\r\n</tr>\r\n\r\n<tr>\r\n <td colspan=\'3\'>\r\n<br>\r\n  </td>\r\n</tr>\r\n\r\n<tr>\r\n <td colspan=\'3\'>\r\n\r\nEste Cuestionario incluye 20 preguntas. Para responder seleccione una sola respuesta para cada pregunta. Debe responder todas las preguntas Recuerde que no existen respuestas buenas o malas. Lo que interesa es su opinión sobre los contenidos y exigencias de su trabajo. Muchas gracias.\r\n</td>\r\n</tr>\r\n\r\n</table>\r\n',NULL,11,NULL,NULL,NULL,1,NULL,NULL,1,2,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Pregunta Cuestionario',NULL,NULL,11,6,NULL,NULL,2,0,NULL,1,2,1,1,1,8,1,1,NULL,NULL,NULL,NULL,NULL),(14,'Boton Guardar','Guardar',NULL,11,NULL,NULL,NULL,3,NULL,NULL,1,2,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
